import {BrowserRouter as Router,Routes} from 'react-router-dom';
import "./App.css";
import Home from './Containers/Home';
import Signin from './Containers/Signin';
import Signup from './Containers/Signup';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Routes path="/" Components={Home}/>
          <Routes path="/" Components={Signin}/>
          <Routes path="/" Components={Signup}/>
        </Routes>

      </Router>
    </div>
  );
}

export default App;
